import React from 'react';
import QnA from '../content/QnA'
import SelButton from '../component/SelButton';

function Comp({ page, question, answers}) {
    return (
        <div>
            <h3>{ page }</h3>
            <h1> { question }</h1>
            {answers.map(answer => (
                <SelButton answer= {answer.answer} value={answer.value} />
            ))}
        </div>
    );
}

function Test() {
    return (
        <div>
            {/* {QnA.map( page => (
                <Comp page={page.page} question={page.question} answers={page.answers}/>
            ))} */}
            {console.log(QnA)}
        </div>
    );
}

export default Test;
